import React from 'react'
import './preview.scss'
import Collect from '../collection-item/collect.component'

const CollectPreview=({title,items})=>{
    return(
        <div className='collect-preivew' >
        <h1 className='title' >{title.toUpperCase()}</h1>
        <div className="preview" >
        {items.filter((item,index)=>{return index<4}).map((item)=>{
            return(
                <Collect key={item.id}>{item.name}</Collect>
            )
        })   
        }
        </div>
        </div>
    )
}

export default CollectPreview;
